import React from 'react'
//import "./active.css"

const Active = props => (
    <div>
        <div className="proj">
        <h3>Project name:</h3>
        {props.name}
        </div>

        <p>Curator: {props.curs}</p>
        <p>Отработанные часы: {props.time}</p>
    </div>
)


export default Active
